import {
  Mail,
  MessageSquare,
  CheckSquare,
  Calendar,
  FileText,
  Circle,
  ShoppingCart,
  User,
  Gift,
  Package,
} from "react-feather";

export default [
  {
    header: "Bán hàng",
  },
  {
    id: "invoice",
    title: "Hoá đơn",
    icon: <FileText size={20} />,
    navLink: "/cms/customer/list",
    children: [
      {
        id: "list",
        title: "Danh sách",
        icon: <Circle size={12} />,
        navLink: "/cms/property/made-in/list",
      },
      {
        id: "add",
        title: "Thêm",
        icon: <Circle size={12} />,
        navLink: "/cms/property/made-in/add",
      },
    ],
  },
  {
    id: "gift",
    title: "Phiếu quà tặng",
    icon: <Gift size={20} />,
    navLink: "/cms/customer/list",
    children: [
      {
        id: "list",
        title: "Danh sách",
        icon: <Circle size={12} />,
        navLink: "/cms/property/made-in/list",
      },
      {
        id: "add",
        title: "Thêm",
        icon: <Circle size={12} />,
        navLink: "/cms/property/made-in/add",
      },
    ],
  },
  {
    id: "Promotion",
    title: "Khuyến mại",
    icon: <Package size={20} />,
    navLink: "/cms/customer/list",
    children: [
      {
        id: "list",
        title: "Danh sách",
        icon: <Circle size={12} />,
        navLink: "/cms/property/made-in/list",
      },
      {
        id: "add",
        title: "Thêm",
        icon: <Circle size={12} />,
        navLink: "/cms/property/made-in/add",
      },
    ],
  },
];
